import React from 'react';
import './index.css';

function App() {
  return (
    <div class="grid grid-cols-1 gap-4 m-5 justify-center">
      <div>
        <h1 class="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      <div class="form-check flex flex-row items-center">
        <input type="checkbox" class="w-3 h-4 bg-gray-50 rounded border border-gray-300 focus:ring-3 focus:ring-blue-300 dark:bg-gray-700 dark:border-gray-600 dark:focus:ring-blue-600 dark:ring-offset-gray-800" />
        <p class="ml-3 text-2xl">Add task</p>
      </div>
    </div>
  );
}

export default App;
